export default props => (
  <div>
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Date</th>
          <th>Victims</th>
          <th>Location</th>
        </tr>
      </thead>
      <tbody>
        {props.killers.map(killer => (
          <tr key={killer.id}>
            <td>{killer.name}</td>
            <td>{killer.username}</td>
            <td>{killer.name.length}</td>
            <td>{killer.address.city}</td>
          </tr>
        ))}
      </tbody>
    </table>
    <style jsx>{`
      table,
      td,
      th {
        border: 1px solid black;
      }

      table {
        border-collapse: collapse;
      }
    `}</style>
  </div>
);
